import logo from './logo.svg';
import './App.css';


const user = {
  name: 'Hedy Lamarr',
  imageUrl: 'https://i.imgur.com/yXOvdOSs.jpg',
  imageSize: 90,
};
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Welcome to my first REACT project
        </p>
        <h1>{user.name}</h1>
        <img
        className="avatar"
        src={user.imageUrl}
        alt={'Photo of ' + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}
      />
      </header>
    </div>
  );
}

export default App;
